import * as React from 'react';
import Box from '@mui/material/Box';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

class BasicSelect extends React.Component {
  constructor(){
    const [order, setOrder] = React.setState('');
    const orderChange = (event) => {
      setOrder(event.target.value);
    };
    const [suborder, setsubOrder] = React.setState('');
    const subOrderChange = (event) => {
      setsubOrder(event.target.value);
    };
    const [genus, setGenus] = React.setState('');
    const GenusChange = (event) => {
      setGenus(event.target.value);
    };
    const [subgenus, setsubGenus] = React.setState('');
    const subGenusChange = (event) => {
      setsubGenus(event.target.value);
    };
    const [family, setFamily] = React.setState('');
    const FamilyChange = (event) => {
      setFamily(event.target.value);
    };
    const [subfamily, setsubFamily] = React.setState('');
    const subFamilyChange = (event) => {
      setsubFamily(event.target.value);
    };
    const [species, setSpecies] = React.setState('');
    const SpeciesChange = (event) => {
      setSpecies(event.target.value);
    };
    const [subspecies, setsubSpecies] = React.setState('');
    const subSpeciesChange = (event) => {
      setsubSpecies(event.target.value);
    };
  }
  render() {
    return (
      <Box sx={{m:1, border: 1, borderColor: 'green', width:130}}>
        <button buttonStyle='btn--outline'>SEARCH</button>
        <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
          <InputLabel id="demo-simple-select-label">Order</InputLabel>
          <Select
            labelId="order-label"
            id="order-select"
            value={this.order}
            label="Order"
            onChange={this.orderChange}
          >
            <MenuItem value="">
              <em>None</em>
            </MenuItem>
            <MenuItem value={10}>Ten</MenuItem>
            <MenuItem value={20}>Four</MenuItem>
            <MenuItem value={30}>Quad</MenuItem>
          </Select>
        </FormControl>
        <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
        <InputLabel id="demo-simple-select-label">SubOrder</InputLabel>
          <Select
            labelId="suborder-label"
            id="suborder-select"
            value={this.suborder}
            label="subOrder"
            onChange={this.subOrderChange}
          >
            <MenuItem value={10}>Ten</MenuItem>
            <MenuItem value={20}>Twenty</MenuItem>
            <MenuItem value={30}>Thirty</MenuItem>
          </Select>
        </FormControl>
        <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
        <InputLabel id="demo-simple-select-label">Genus</InputLabel>
          <Select
            labelId="genus-label"
            id="genus-select"
            value={this.genus}
            label="Genus"
            onChange={this.GenusChange}
          >
            <MenuItem value={10}>Ten</MenuItem>
            <MenuItem value={20}>Twenty</MenuItem>
            <MenuItem value={30}>Thirty</MenuItem>
          </Select>
        </FormControl>
        <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
        <InputLabel id="demo-simple-select-label">SubGenus</InputLabel>
          <Select
            labelId="subgenus-label"
            id="subgenus-select"
            value={this.subgenus}
            label="subGenus"
            onChange={this.subGenusChange}
          >
            <MenuItem value={10}>Ten</MenuItem>
            <MenuItem value={20}>Twenty</MenuItem>
            <MenuItem value={30}>Thirty</MenuItem>
          </Select>
        </FormControl>
        <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
        <InputLabel id="demo-simple-select-label">Family</InputLabel>
          <Select
            labelId="family-label"
            id="family-select"
            value={this.family}
            label="family"
            onChange={this.FamilyChange}
          >
            <MenuItem value={10}>Ten</MenuItem>
            <MenuItem value={20}>Twenty</MenuItem>
            <MenuItem value={30}>Thirty</MenuItem>
          </Select>
        </FormControl>
        <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
        <InputLabel id="demo-simple-select-label">SubFamily</InputLabel>
          <Select
            labelId="subfamily-label"
            id="subfamily-select"
            value={this.subfamily}
            label="subfamily"
            onChange={this.subFamilyChange}
          >
            <MenuItem value={10}>Ten</MenuItem>
            <MenuItem value={20}>Twenty</MenuItem>
            <MenuItem value={30}>Thirty</MenuItem>
          </Select>
        </FormControl>
        <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
          <InputLabel id="demo-simple-select-label">Species</InputLabel>
          <Select
            labelId="species-label"
            id="species-select"
            value={this.species}
            label="Species"
            onChange={this.SpeciesChange}
          >
            <MenuItem value="">
              <em>None</em>
            </MenuItem>
            <MenuItem value={10}>Ten</MenuItem>
            <MenuItem value={20}>Four</MenuItem>
            <MenuItem value={30}>Quad</MenuItem>
          </Select>
        </FormControl>
        <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
          <InputLabel id="demo-simple-select-label">SubSpecies</InputLabel>
          <Select
            labelId="subspecies-label"
            id="subspecies-select"
            value={this.subspecies}
            label="Species"
            onChange={this.subSpeciesChange}
          >
            <MenuItem value="">
              <em>None</em>
            </MenuItem>
            <MenuItem value={10}>Ten</MenuItem>
            <MenuItem value={20}>Four</MenuItem>
            <MenuItem value={30}>Quad</MenuItem>
          </Select>
        </FormControl>
      </Box>
    );
  }
}

export default BasicSelect;
